import React from 'react';
import Heading from './Heading'
import Card from './Card'

function App() {
  return (<div>
    <Heading />
    <Card name="ABC" num="+123"/>
    <Card name="BCA" num="+432"/>
    <Card name="BAC" num="+234"/>
  <Card />
  </div>);
}

export default App;
